import React from "react";
import {BrowserRouter,Route} from "react-router-dom";
import App from "./components/Home/App";

const AppRouter = () => {
    return (
     <BrowserRouter>
      <div>
       <Route path='/' exact component={App} />
      </div>
     </BrowserRouter>
    );
   };


   export default AppRouter;
